import React from "react";
import styled from "styled-components";
const NavContainer = styled.div`
  width: 100vw;
  z-index: 6;
  position: absolute;
  top: 0;

  display: flex;
  justify-content: center;
  align-items: center;
`;

const MenuBtn = styled.li`
    background-color: ${`rgba`}
`


const Navbar = () => {
  return (
    <NavContainer>
      <li>Menu</li>
    </NavContainer>
  );
};

export default Navbar;
